lfn_RadioOnChanged = function(info) {
	//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_01] [this.getID()] "+ this.getID() );

    var comp;
    var arrList;
    var arrListTmp;  
	arrList = this.getID().split("_");	 // split 처리
    var compCnt = B230_Div1.getChildrenCount();		// Components 총 수 
  	//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_02] [this.getID()] "+ this.getID() +"[this.getValue()]"+ this.getValue() +"[compCnt]"+ compCnt ); 

    for (i = 0; i < compCnt; i++) {	 //정렬할 배열 담기 
        comp = B230_Div1.getAllChildren()[i];		// Components 담기 
		//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_02_1] [i_번째]"+ i +"[comp.id]"+ comp.id );

   		 if (util.isNull(comp)) {		// comp가 널 이면 다음 i번째로 진행
        	continue;
         }
 		if (comp.id.indexOf("Static") > -1 || comp.id.indexOf("static") > -1) {	     // static 존재하면(제외 시킴) 
 			continue;
        }   
        if (comp.id.indexOf("group") > -1) {	     // group 존재하면(제외 시킴) ;
 	  		continue;
        }          
		if (comp.id.indexOf("Shape") > -1) {	     // Shape 존재하면(제외 시킴)  
 	  		continue;
        }         
        if (comp.id.indexOf("wq_uuid") > -1) {	     // wq_uuid 존재하면(제외 시킴)  
 	  		continue;
        }  

    	var comp2 = {};  
    	comp2.id = comp.id;	// Component ID 
     	var tmpObj = WebSquare.util.getComponentById(comp2.id);   
     	comp2.getType = tmpObj.getPluginName();		// Component 타입
    	comp2.value = tmpObj.getValue();			// Component value  
    	comp2.enable = !tmpObj.getDisabled();	 		// Component disabled  Obj.getValue()
    	comp2.Obj   = tmpObj; 
       //console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_12] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[comp2.Obj.getValue()]"+ comp2.Obj.getValue() +"[parent.sDrveType]"+ parent.sDrveType );

        if (comp2.id.indexOf(parent.sDrveType) > 0) {	     // 같은 sDrveType이 존재하면 
        	//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_M_21] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[arrList[1]]"+ arrList[1] +"[substr(arrList[1], 0, 4)]"+ wconv.substr(arrList[1], 0, 4)  +"[comp2.id.indexOf(wconv.substr(arrList[1], 0, 4))]"+ comp2.id.indexOf(wconv.substr(arrList[1], 0, 4)) );

        	if (",A2000,A0700,A0800,A2100,A1000,A2200".indexOf(arrList[1]) > 0) {	// 5자리 같은 질의코드가 존재하면 ==> A0400중 4자리까지만 찾음		 ==> //예외처리
                arrListTmp = comp2.id.split("_");	 // split 처리
                //console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_14] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[arrListTmp[1]]"+ arrListTmp[1] +"[arrListTmp]"+ arrListTmp  );  

 				if (arrListTmp[1] >= "A1003" && arrListTmp[1] <= "A1012") {   // 코드가  'A1003' 크거나 같고'A1012' 적거나 같으면
 					//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_15] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[arrListTmp[1]]"+ arrListTmp[1] +"[arrListTmp]"+ arrListTmp  );  

 					if (rad_A2000_1_1_0.getValue() == "N" && rad_A0700_1_1_0.getValue() == "N" && rad_A0800_1_1_0.getValue() == "N" 
 						&& rad_A2100_1_1_0.getValue() == "N" && rad_A1000_1_1_0.getValue() == "N") {
 						//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_16] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[arrListTmp[1]]"+ arrListTmp[1] +"[arrListTmp]"+ arrListTmp  );  

                        if (this.getValue() == "N") {		// 아니오 이면
                        	//comp2.Obj.setStyle("background-color","");		// 배경색 설정 
                            comp2.Obj.setValue("");   // 해당 컴포넌트와 관련된 하위 컴포넌트 널 처리  
                  			comp2.enable = false;
                        	comp2.Obj.setDisabled(true);		// 비활성화 처리
                        	comp2.Obj.setReadOnly(true);		// 비 활성화 처리(ReadOnly)
                        	//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_21] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[comp2.Obj.getValue()]"+ comp2.Obj.getValue() +"[comp2.enable)]"+ comp2.enable );
     					}
                    } else {
                        comp2.enable = true;
            			comp2.Obj.setDisabled(false);		// 활성화 처리
            			comp2.Obj.setReadOnly(false);	// 활성화 처리(ReadOnly)
            			//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_22] [활성화 처리] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[comp2.Obj.getValue()]"+ comp2.Obj.getValue() +"[comp2.enable)]"+ comp2.enable )

                    }	//  end of if
                } //  end of if ==> 코드가  'A1003' 크거나 같고'A1012' 적거나 같으면
            }  //  end of if ==> // 5자리 같은 질의코드가 존재하면

  			//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_M_41] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[arrList[1]]"+ arrList[1] +"[wconv.substr(arrList[1], 0, 3)]"+ wconv.substr(arrList[1], 0, 3) );

           if (comp2.id.indexOf(wconv.substr(arrList[1], 0, 3)) > 0) {	// 4자리 같은 질의코드가 존재하면
            	arrListTmp = comp2.id.split("_");	 // split 처리
          		//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_M_51] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[arrList[1]]"+ arrList[1] +"[this.getID()]"+ this.getID() +"[this.getValue()]"+ this.getValue() );

                //예/아니오 객체는 빼고 나머지만 초기화
                if (wconv.substr(arrListTmp[1], 3, 2) != "00") {  
                	 if (arrListTmp[1] >= "A1003" && arrListTmp[1] <= "A1012") {
                	 } else if (this.getValue() == "N") {		//  아니오 이면   
                	 	//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_91] [비활성화 처리] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[comp2.getType]"+ comp2.getType +"[this.getValue()]"+ this.getValue() );

	               		comp2.Obj.setValue("");   // 해당 컴포넌트와 관련된 하위 컴포넌트 널 처리  
	            		comp2.enable = false;
                   		comp2.Obj.setDisabled(true);		// 비활성화 처리 
                   		comp2.Obj.setReadOnly(true);		// 비 활성화 처리(ReadOnly)
                 		//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_91_2] [비활성화 처리] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[this.getID()] "+ this.getID() +"[this.getValue()]"+ this.getValue() );

	           	 	} else {
						//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_92] [활성화 처리] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[this.getValue()]"+ this.getValue() );

	               		comp2.enable = true;
            			comp2.Obj.setDisabled(false);			// 활성화 처리
            			comp2.Obj.setReadOnly(false);	// 활성화 처리(ReadOnly)
	            	}
                }
                //console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_M_52] [i_번째]"+ i +"[comp2.id]"+ comp2.id +"[arrList[1]]"+ arrList[1] +"[this.getID()] "+ this.getID() );

            }   // end of if ==> 4자리 같은 질의코드가 존재하면
		}  //  end of if ==> 같은 sDrveType이 존재하면 
		//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_12_end] [같은 질의코드를 찾음][i_번째]"+ i +"[comp2.id]"+ comp2.id +"[comp2.Obj.getValue()]"+ comp2.Obj.getValue() +"[parent.sDrveType]"+ parent.sDrveType ); 
	}	//  end of for()
    //console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_91]" );

	//console.log("[/CBSC171S.xml] [lfn_RadioOnChanged()] ==> [Radio 변경 이벤트 처리] [TEST_end]" );
};

